/* Input event processing: */
void ACM_signals_GenerateInputSignalEvents(
        ACM_signals_InputSignals *old_values,
        ACM_signals_InputSignals *new_values,
        ACM_signals_InputSignalEvents *events )
{
    events->btnInc_up = ( old_values->btnInc<=0 && new_values->btnInc>0 );
    events->btnDec_up = ( old_values->btnDec<=0 && new_values->btnDec>0 );
    events->btnAssist_mode_up = ( old_values->btnAssist_mode<=0 && new_values->btnAssist_mode>0 );
}

