/* Place Output Processing */
void ACM_signals_GeneratePlaceOutputSignals(
    ACM_signals_NetMarking *marking,
    ACM_signals_InputSignals *inputs,
    ACM_signals_PlaceOutputSignals *place_out,
    ACM_signals_EventOutputSignals *ev_out )
{
    int exp_res, new_val, n_writes;
    ACM_signals_PlaceOutputSignals new_out = *place_out;
    
    /* Signal tpi_inChg */
    new_val = 0;
    if( marking->p_308 > 0 ) { /* Place joy_inChg */
        exp_res = 0;
        if( 1 )
            new_val = exp_res;
    }
    if( marking->p_306 > 0 ) { /* Place tpi_inChg */
        exp_res = 1;
        if( ABS(exp_res-0) > ABS(new_val-0) )
            new_val = exp_res;
    }
    if( new_val > 1 ) new_out.tpi_inChg = 1;
    else if( new_val < 0 ) new_out.tpi_inChg = 0;
    else new_out.tpi_inChg = new_val;

    /* Signal ForwardQ */
    new_val = 1;
    if( marking->p_710 > 0 ) { /* Place Forward */
        exp_res = 0;
        if( 1 )
            new_val = exp_res;
    }
    if( new_val > 1 ) new_out.ForwardQ = 1;
    else if( new_val < 0 ) new_out.ForwardQ = 0;
    else new_out.ForwardQ = new_val;

    /* Signal ReverseQ */
    new_val = 1;
    if( marking->p_387 > 0 ) { /* Place Backward */
        exp_res = 0;
        if( 1 )
            new_val = exp_res;
    }
    if( new_val > 1 ) new_out.ReverseQ = 1;
    else if( new_val < 0 ) new_out.ReverseQ = 0;
    else new_out.ReverseQ = new_val;

    /* Signal RightQ */
    new_val = 1;
    if( marking->p_726 > 0 ) { /* Place Right */
        exp_res = 0;
        if( 1 )
            new_val = exp_res;
    }
    if( new_val > 1 ) new_out.RightQ = 1;
    else if( new_val < 0 ) new_out.RightQ = 0;
    else new_out.RightQ = new_val;

    /* Signal LeftQ */
    new_val = 1;
    if( marking->p_386 > 0 ) { /* Place Left */
        exp_res = 0;
        if( 1 )
            new_val = exp_res;
    }
    if( new_val > 1 ) new_out.LeftQ = 1;
    else if( new_val < 0 ) new_out.LeftQ = 0;
    else new_out.LeftQ = new_val;

    /* Signal Horn */
    new_val = 0;
    if( marking->p_496 > 0 ) { /* Place horn_OFF */
        exp_res = 0;
        if( 1 )
            new_val = exp_res;
    }
    if( marking->p_495 > 0 ) { /* Place horn_ON_button */
        exp_res = 1;
        if( ABS(exp_res-0) > ABS(new_val-0) )
            new_val = exp_res;
    }
    if( new_val > 1 ) new_out.Horn = 1;
    else if( new_val < 0 ) new_out.Horn = 0;
    else new_out.Horn = new_val;

    /* Signal speedDial */
    new_val = 0;
    if( marking->p_505 > 0 ) { /* Place speed_100 */
        exp_res = 3;
        if( 1 )
            new_val = exp_res;
    }
    if( marking->p_502 > 0 ) { /* Place speed_25 */
        exp_res = 0;
        if( ABS(exp_res-0) > ABS(new_val-0) )
            new_val = exp_res;
    }
    if( marking->p_503 > 0 ) { /* Place speed_50 */
        exp_res = 1;
        if( ABS(exp_res-0) > ABS(new_val-0) )
            new_val = exp_res;
    }
    if( marking->p_504 > 0 ) { /* Place speed_75 */
        exp_res = 2;
        if( ABS(exp_res-0) > ABS(new_val-0) )
            new_val = exp_res;
    }
    if( new_val > 3 ) new_out.speedDial = 3;
    else if( new_val < 0 ) new_out.speedDial = 0;
    else new_out.speedDial = new_val;

    /* Signal back_alert */
    new_val = 0;
    if( marking->p_545 > 0 ) { /* Place back_0 */
        exp_res = 0;
        if( 1 )
            new_val = exp_res;
    }
    if( marking->p_546 > 0 ) { /* Place back_1 */
        exp_res = 1;
        if( ABS(exp_res-0) > ABS(new_val-0) )
            new_val = exp_res;
    }
    if( marking->p_547 > 0 ) { /* Place back_2 */
        exp_res = 2;
        if( ABS(exp_res-0) > ABS(new_val-0) )
            new_val = exp_res;
    }
    if( marking->p_548 > 0 ) { /* Place back_3 */
        exp_res = 3;
        if( ABS(exp_res-0) > ABS(new_val-0) )
            new_val = exp_res;
    }
    if( new_val > 3 ) new_out.back_alert = 3;
    else if( new_val < 0 ) new_out.back_alert = 0;
    else new_out.back_alert = new_val;

    /* Signal left_alert */
    new_val = 0;
    if( marking->p_567 > 0 ) { /* Place left_0 */
        exp_res = 0;
        if( 1 )
            new_val = exp_res;
    }
    if( marking->p_568 > 0 ) { /* Place left_1 */
        exp_res = 1;
        if( ABS(exp_res-0) > ABS(new_val-0) )
            new_val = exp_res;
    }
    if( marking->p_569 > 0 ) { /* Place left_2 */
        exp_res = 2;
        if( ABS(exp_res-0) > ABS(new_val-0) )
            new_val = exp_res;
    }
    if( marking->p_570 > 0 ) { /* Place left_3 */
        exp_res = 3;
        if( ABS(exp_res-0) > ABS(new_val-0) )
            new_val = exp_res;
    }
    if( new_val > 3 ) new_out.left_alert = 3;
    else if( new_val < 0 ) new_out.left_alert = 0;
    else new_out.left_alert = new_val;

    /* Signal right_alert */
    new_val = 0;
    if( marking->p_589 > 0 ) { /* Place right_0 */
        exp_res = 0;
        if( 1 )
            new_val = exp_res;
    }
    if( marking->p_590 > 0 ) { /* Place right_1 */
        exp_res = 1;
        if( ABS(exp_res-0) > ABS(new_val-0) )
            new_val = exp_res;
    }
    if( marking->p_591 > 0 ) { /* Place right_2 */
        exp_res = 2;
        if( ABS(exp_res-0) > ABS(new_val-0) )
            new_val = exp_res;
    }
    if( marking->p_592 > 0 ) { /* Place right_3 */
        exp_res = 3;
        if( ABS(exp_res-0) > ABS(new_val-0) )
            new_val = exp_res;
    }
    if( new_val > 3 ) new_out.right_alert = 3;
    else if( new_val < 0 ) new_out.right_alert = 0;
    else new_out.right_alert = new_val;

    /* Signal front_alert */
    new_val = 0;
    if( marking->p_611 > 0 ) { /* Place front_flat */
        exp_res = 0;
        if( 1 )
            new_val = exp_res;
    }
    if( marking->p_612 > 0 ) { /* Place front_step */
        exp_res = 1;
        if( ABS(exp_res-0) > ABS(new_val-0) )
            new_val = exp_res;
    }
    if( new_val > 1 ) new_out.front_alert = 1;
    else if( new_val < 0 ) new_out.front_alert = 0;
    else new_out.front_alert = new_val;

    /* Signal Assist_mode */
    new_val = 0;
    if( marking->p_635 > 0 ) { /* Place Assist_mode_OFF */
        exp_res = 0;
        if( 1 )
            new_val = exp_res;
    }
    if( marking->p_634 > 0 ) { /* Place Assist_mode_ON */
        exp_res = 1;
        if( ABS(exp_res-0) > ABS(new_val-0) )
            new_val = exp_res;
    }
    if( new_val > 1 ) new_out.Assist_mode = 1;
    else if( new_val < 0 ) new_out.Assist_mode = 0;
    else new_out.Assist_mode = new_val;

    /* Signal pitch_alert */
    new_val = 0;
    if( marking->p_822 > 0 ) { /* Place leveled */
        exp_res = 0;
        if( 1 )
            new_val = exp_res;
    }
    if( marking->p_849 > 0 ) { /* Place tilted_down_1 */
        exp_res = -1;
        if( ABS(exp_res-0) > ABS(new_val-0) )
            new_val = exp_res;
    }
    if( marking->p_852 > 0 ) { /* Place tilted_down_2 */
        exp_res = -2;
        if( ABS(exp_res-0) > ABS(new_val-0) )
            new_val = exp_res;
    }
    if( marking->p_855 > 0 ) { /* Place tilted_down_3 */
        exp_res = -3;
        if( ABS(exp_res-0) > ABS(new_val-0) )
            new_val = exp_res;
    }
    if( marking->p_823 > 0 ) { /* Place tilted_up_1 */
        exp_res = 1;
        if( ABS(exp_res-0) > ABS(new_val-0) )
            new_val = exp_res;
    }
    if( marking->p_835 > 0 ) { /* Place tilted_up_2 */
        exp_res = 2;
        if( ABS(exp_res-0) > ABS(new_val-0) )
            new_val = exp_res;
    }
    if( marking->p_842 > 0 ) { /* Place tilted_up_3 */
        exp_res = 3;
        if( ABS(exp_res-0) > ABS(new_val-0) )
            new_val = exp_res;
    }
    if( new_val > 3 ) new_out.pitch_alert = 3;
    else if( new_val < -3 ) new_out.pitch_alert = -3;
    else new_out.pitch_alert = new_val;

    *place_out = new_out;
}

